import React from "react";
import Header from "./Header";
import MenuAdmin from "./MenuAdmin";
import Order from "./Order";

class App extends React.Component {
  render() {
    return (
      <div className="burger-paradise">
        <div className="menu">
          <Header title="Very hot burgers" />
        </div>
        <Order />
        <MenuAdmin />
      </div>
    );
  }
}

export default App;
